Illuminating Highlighter 
@maliaocosmetics.com.pk 
@maliaocosmeticspakistan 
@maliao.professional_makeup 
Shade:03
Net Wt.:15g
Expiry date: 24 months after opening.
Price: Rs.285 + shipping charges
Purchase: I purchased this online from @darazpk.

●Packaging: It is a nice plastic stick with a good grip. It consists of 2 parts: the highlighter and the smudger. The bulb of the highlighter, however, came off as soon as I opened it which was very disappointing. Also, the smudger is not of much use.

●Color: It is a pale pinkish color with a glean of silver.

●Pigmentation: The pigmentation is pretty good and it leaves a subtle sheen wherever you apply it. Will last a good amount of time.

●Blendability: It blends like a dream! It does not emphasize any texture but rather blurs out all your pores and bumps and gives you a soft focus effect. It gives you the glow from within effect for real.💫

●Consistency: It is a cream highlighter and has a sheen to it but has no shimmer or glitter at all. You can apply it with a brush also but I prefer using my fingers to blend it out.

●Final thoughts: The packaging may not be too impressive but it is a very good, affordable highlighter for everyday use. Epecially for people who do not prefer blinding highlighters, this one is for you.
It comes in a total of 6 shades. 
🤍

